function showOverlay() {
         $("#overlay").show();
         $("#overlay").width($(document).width());
         $("#overlay").height($(document).height());
     }

     function closePanel(panel) {
         $(panel).hide();
     }

     function showPanel(panel) {
         //showOverlay();
        
         $(panel).show();
         setSearchPanelLocation(panel);
     }

     function setSearchPanelLocation(panel) {
         var w = ($(window).width() / 2) - ($(panel).width() / 2);
         $(panel).css("left", w);
         $(panel).css("top", 150);
     }
 function submit_issue() {
           jQuery.get("submit-issue.aspx?request=test", function(response) {
               if (response == '1') {
                   closePanel('#userlogin_div');
               } else {
                   alert(response);
               }
           });
           return false;
       }
       
        function loadPage(page, div) {
            if ($.trim($("#" + div).text()) == 'Loading...') {
                $("#" + div).load(page);
            } else {
            }

            $("#" + div).css("display", "inline");
            if (div == 'sources_div') {
                $("#whatsnew_div").css("display", "none");
                $("#about_div").css("display", "none");
            } else if (div == 'whatsnew_div') {
                $("#sources_div").css("display", "none");
                $("#about_div").css("display", "none");
            } else if (div == 'about_div') {
                $("#sources_div").css("display", "none");
                $("#whatsnew_div").css("display", "none");
            }
            window.location.hash = page;
        }